import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './components/home'


function App() {
  return (
    <div className="wrapper">
      <h1>Application</h1>
      <BrowserRouter>
        <Switch>
          <Route path="/home">
            <Home />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
